public class StringPatternMatching
{
    public static void bruteForce(String txt, String pat)
    {
        int n = txt.length();
        int m = pat.length();
        boolean match;

        for (int pos = 0; pos < n-m; pos++)
        {
            match = true;

            int walk;

            for (walk = 0; walk < m; walk++)
            {
                if (txt.charAt(pos + walk) != pat.charAt(walk))
                {
                    match = false;
                    break;
                }
            }

            if (match)
            {
                System.out.println(pat);
            }
        }
    }

    public static void kmp(String txt, String pat)
    {
        int n = txt.length();
        int m = pat.length();
        boolean match;

        int[] lps = new int[m];

        computeLPSArray(pat, lps);

        int j = 0;
        int i = 0;

        while (i < n)
        {
            if (txt.charAt(i) == pat.charAt(j))
            {
                i++;
                j++;
            }

            if (j == m)
            {
                System.out.println(pat);

                j = lps[j-1];
            }

            else if ((i < n) && (txt.charAt(i) != pat.charAt(j)))
            {
                if (j != 0)
                {
                    j = lps[j-1];
                }

                else
                {
                    i++;
                }
            }
        }
    }

    private static void computeLPSArray(String pat, int[] lps)
    {
        int len = 0;
        int i = 1;
        lps[0] = 0;

        while (i < pat.length())
        {
            if (pat.charAt(i) == pat.charAt(len))
            {
                len++;
                lps[i] = len;
                i++;
            }

            else
            {
                if (len != 0)
                {
                    len = lps[len - 1];
                }

                else
                {
                    lps[i] = len;
                    i++;
                }
            }
        }
    }
    public static void main(String[] args)
    {
        String txt1 = "";
        String txt2 = "";
        String txt3 = "";
        String txt4 = "";
        String pat = "a";

        long bruteForceStartTime = System.nanoTime();
        bruteForce(txt1, pat);
        long bruteForceEndTime = System.nanoTime();

        long kmpStartTime = System.nanoTime();
        kmp(txt1, pat);
        long kmpEndTime = System.nanoTime();

        System.out.println("Brute Force Time: " + (bruteForceEndTime - bruteForceStartTime));
        System.out.println("KMP Time: " + (kmpEndTime - kmpStartTime));
    }
}
